from math import inf

def calculate_max_euphony(s: str, k: int, bonuses: list) -> int:
    bonus_dict = [[0] / 26 for _ in range(26)]
    for (x, y, c) in bonuses:
        bonus_dict[ord(x) - 97][ord(y) - 97] = c
    dp = [[[-inf] * 26 for _ in range(k + 2)] for _ in range(len(s))]
    for i in range(26):
        if ord(s[0]) - 97 == i:
            dp[0][0][i] = 0
        else:
            dp[0][1][i] = 0
    for i in range(1, len(s)):
        for j in range(k + 1):
            for p in range(26):
                if ord(s[i]) - 97 == p:
                    for xx in range(26):
                        dp[i][j][p] = max(dp[i - 1][j][xx] + bonus_dict[xx][p], dp[i][j][p])
                else:
                    for xx in range(26):
                        dp[i][j + 1][p] = max(dp[i - 1][j][xx] + bonus_dict[xx][p], dp[i][j + 1][p])
    return max(map(max, dp[-1][:-1]))

